import{_ as o,a}from"./chunks/teamone_sheet.p3bYpXUa.js";import{_ as t,a as d}from"./chunks/tm1datacompare_result.DrjEBd-H.js";import{_ as s,c as r,o as i,ag as n}from"./chunks/framework.BG_SpCm2.js";const c="/teamone/img/tasks/tm1data.png",l="/teamone/img/tasks/tm1data_result.png",h="/teamone/img/tasks/tm1import_option1.png",m="/teamone/img/tasks/tm1import_option2.png",p="/teamone/img/tasks/tm1fileoutput.png",u="/teamone/img/tasks/task_group.png",S=JSON.parse('{"title":"TeamOne","titleTemplate":"Tasks","description":"","frontmatter":{"title":"TeamOne","titleTemplate":"Tasks"},"headers":[],"relativePath":"doc/tasks.md","filePath":"doc/tasks.md"}'),f={name:"doc/tasks.md"};function b(g,e,k,w,T,v){return i(),r("div",null,e[0]||(e[0]=[n('<h1 id="tasks" tabindex="-1">Tasks <a class="header-anchor" href="#tasks" aria-label="Permalink to &quot;Tasks&quot;">​</a></h1><h2 id="what-are-tasks" tabindex="-1">What Are Tasks <a class="header-anchor" href="#what-are-tasks" aria-label="Permalink to &quot;What Are Tasks&quot;">​</a></h2><p>Tasks enable one-click automations for various Google Sheets and IBM Planning Analytics routines — such as recalculating sheets, running TI processes, uploading data, comparing results, and more.<br> You can define tasks either in the <a href="./#teamone-configuration">TeamOne Configuration</a> screen or directly on the sheet named <a href="/teamone/#teamone-sheet">.TEAMONE</a>.</p><p><img src="'+o+'" alt="TeamOne configuration screen" data-zoomable=""></p><p>To execute a task, simply click on it from the <strong>TeamOne</strong> sidebar:</p><p><img src="'+t+'" alt="TeamOne tasks tab" data-zoomable=""></p><h2 id="teamone-sheet" tabindex="-1">.TeamOne sheet <a class="header-anchor" href="#teamone-sheet" aria-label="Permalink to &quot;.TeamOne sheet&quot;">​</a></h2><p>You can define tasks directly in a special sheet named <code>.TEAMONE</code>. This method is ideal when you want to manage tasks inside the spreadsheet itself, use formulas for dynamic values, or maintain a large list of tasks in one place.</p><p>For each task, enter the <code>::tasktype</code> in <strong>column A</strong> and the task name in <strong>column B</strong>, continue with options and parameters on the following rows.</p><p><strong>Options</strong> are predefined arguments that control task behavior. They always start with a dash (<code>-</code>), for example, use the <code>-info</code> option to specify the task hint or use the <code>-hide</code> option to hide the task in the sidebar.</p><p><strong>Parameters</strong> are custom arguments that can vary between tasks. They do not start with a dash. The order of parameters may matter for certain task types. For example, you can specify the list of sheets to recalculate using the <a href="./#sheet-recalculate">::sheet.recalculate</a> task or combine multiple tasks names into a single <a href="./#task-group">::task.group</a></p><p><img src="'+a+'" alt="TeamOne sheet" data-zoomable=""></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You can start by creating a task in the TeamOne Configuration menu, then use <code>Move to .TEAMONE</code> sheet to transfer it to the <code>.TEAMONE</code> sheet.</p><p>When defining tasks in the <code>.TEAMONE</code> sheet, you can use formulas to make them dynamic. For example, use <code>=YEAR(TODAY())</code> to pass the current year as a parameter to a <a href="./#tm1process">tm1process</a> task.</p></div><h2 id="sheet-recalculate" tabindex="-1"><code>::sheet.recalculate</code> <a class="header-anchor" href="#sheet-recalculate" aria-label="Permalink to &quot;`::sheet.recalculate`&quot;">​</a></h2><p>The <code>::sheet.recalculate</code> task is used to recalculate one or more Google Sheets within the workbook. This is useful when you want to trigger a recalculation of dynamic formulas, refresh dependent cells, or run on-sheet logic manually.</p><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>Sheet1-SheetN</code></td><td>Enter one or more sheet names in <strong>column A</strong>. Each row should contain a single sheet name to be recalculated.</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>To recalculate sheets named <code>Summary</code>, <code>Input</code>, and <code>Forecast</code>, enter them in separate rows under column A. You can combine this task with other tasks in a sequence to refresh sheet data before or after importing/exporting TM1 data.</p></div><h2 id="sheet-truncate" tabindex="-1"><code>::sheet.truncate</code> <a class="header-anchor" href="#sheet-truncate" aria-label="Permalink to &quot;`::sheet.truncate`&quot;">​</a></h2><p>The <code>::sheet.truncate</code> task is used to clean up one or more sheets by removing rows from the bottom. This is especially useful when resetting upload templates or clearing leftover data.</p><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>-keepRows</code></td><td>If specified, only the given number of rows at the top will be retained. All rows below will be deleted, even if they contain data.</td></tr><tr><td><code>-addRows</code></td><td>If specified, the task will add the given number of empty rows at the bottom after truncation.</td></tr><tr><td><code>Sheet1-SheetN</code></td><td>Enter one or more sheet names in <strong>column A</strong>. Each row should contain a single sheet name to truncate.</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Use this task to reset upload sheets before reloading data, especially in conjunction with <code>::tm1import</code>.</p></div><ul><li>If <code>-keepRows</code> is <strong>not specified</strong>, only empty rows at the bottom of the sheet will be deleted.</li><li>If <code>-keepRows</code> <strong>is specified</strong>, the sheet will be reduced to that number of rows, regardless of whether they are empty.</li><li>If <code>-addRows</code> is used, empty rows will be added at the bottom after deletion to maintain a consistent template size.</li></ul><p><em>Example:</em><br> To truncate and reset sheets named <code>Upload_Actuals</code> and <code>Upload_Forecast</code>, list them in <strong>column A</strong> and optionally specify <code>-keepRows</code> and <code>-addRows</code> as needed.</p><h2 id="sheet-snapshot" tabindex="-1"><code>::sheet.snapshot</code> <a class="header-anchor" href="#sheet-snapshot" aria-label="Permalink to &quot;`::sheet.snapshot`&quot;">​</a></h2><p>The <code>::sheet.snapshot</code> task creates a copy of each specified sheet with all data and formatting preservedw ith formulas replaced by their current values. This is useful for freezing a report or upload template in its current state.</p><p>Each snapshot is created as a new sheet with the same name and <code>&quot; (snapshot)&quot;</code> suffix.</p><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>Sheet1-SheetN</code></td><td>Enter one or more sheet names in <strong>column A</strong>. Each row should contain a single sheet name to snapshot.</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">Behavior</p><ul><li>If a snapshot sheet with the same name already exists (e.g., <code>&quot;Sheet1 (snapshot)&quot;</code>), it is deleted and recreated.</li><li>The new sheet is inserted <strong>immediately after</strong> the original sheet.</li><li>The following are preserved: <ul><li>Cell formatting (number formats, colors, fonts)</li><li>Column widths and row heights</li><li>Frozen panes</li><li>Filters and conditional formatting</li><li>Merged cells</li></ul></li><li>The following are <strong>not</strong> preserved: <ul><li><strong>Formulas</strong> (they are replaced with their evaluated values)</li><li>Hyperlinks</li><li>Data validation</li><li>Named ranges</li></ul></li></ul></div><h2 id="tm1process" tabindex="-1"><code>::tm1process</code> <a class="header-anchor" href="#tm1process" aria-label="Permalink to &quot;`::tm1process`&quot;">​</a></h2><p>The <code>::tm1process</code> task runs TM1 TurboIntegrator (TI) processes. Use the table below to define the process name and its parameters:</p><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>-name</code></td><td>TI process name. If omitted, the task name is used.</td></tr><tr><td><code>-tm1env</code></td><td>TM1 environment to run the process in. Must match a defined <code>::tm1env</code>. Defaults to the selected environment in the TeamOne sidebar.</td></tr><tr><td><code>parameter 1–N</code></td><td>Enter parameter name in <strong>column A</strong> and its value in column B. If a parameter is omitted, its default value will be used.</td></tr></tbody></table><p>After running the task via the sidebar, the result will be shown in the log panel.</p><p><img src="'+t+'" alt="TM1 process task" data-zoomable=""></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You can generate a <code>::tm1process</code> task using the <a href="./processes.html#process-task">sidebar process menu</a>, which will auto-populate the process name and parameters.</p></div><p>View <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=858904422" target="_blank" rel="noreferrer">::tm1process example</a></p><h2 id="tm1data" tabindex="-1"><code>::tm1data</code> <a class="header-anchor" href="#tm1data" aria-label="Permalink to &quot;`::tm1data`&quot;">​</a></h2><p>The <code>::tm1data</code> task queries TM1 data using a view, MDX, or dimension element definitions. The result is printed to the specified sheet.</p><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>-tm1env</code></td><td>TM1 environment to use. Defaults to the selected one.</td></tr><tr><td><code>-sheet</code></td><td>Output sheet name.</td></tr><tr><td><code>-activate</code></td><td>If set, switches to the output sheet after data is printed.</td></tr><tr><td><code>-cube</code></td><td>Cube name. Required when using <code>-view</code> or dimension definitions.</td></tr><tr><td><code>-view</code></td><td>Existing cube view to fetch data from. Requires <code>-cube</code>.</td></tr><tr><td><code>-mdx</code></td><td>MDX query. Used only if <code>-view</code> is not provided.</td></tr><tr><td><code>Dimension 1–N</code></td><td>Enter dimension name in <strong>column A</strong> and subset/elements/MDX in column B. Requires <code>-cube</code>.</td></tr></tbody></table><p>Accepted formats for dimension values in column B:</p><ul><li>Semicolon-separated list: <code>Actual;Budget;Forecast</code></li><li>Subset name: <code>$SubsetName</code></li><li>System subsets: <code>$ALL</code>, <code>$LEAVES</code>, <code>$ROOTS</code></li><li>MDX: <code>{[Calendar].[FY2026].Children}</code></li><li>Pattern matching: <code>/FY2026 Q?/</code>, <code>/*Revenue*/</code></li><li>Mixed list: <code>FY2025;FY2026;{[Calendar].[FY2026].Children};/FY2027 Q?/</code></li></ul><p>If <strong>column B</strong> is left blank, the default member is used.</p><p><img src="'+c+'" alt="tm1data task" data-zoomable=""></p><p>The result is printed to the sheet defined in <code>-sheet</code>:</p><p><img src="'+l+'" alt="tm1data task results" data-zoomable=""></p><p>View <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=858904422" target="_blank" rel="noreferrer">::tm1data example</a></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You can generate a <code>::tm1data</code> task from the <a href="./model.html#cube-node">cube</a> or <a href="./model.html#view-node">view</a> menu in the model tab.</p></div><h2 id="tm1import" tabindex="-1"><code>::tm1import</code> <a class="header-anchor" href="#tm1import" aria-label="Permalink to &quot;`::tm1import`&quot;">​</a></h2><p>The <code>::tm1import</code> task uploads data from a Google Sheet into a TM1 cube.</p><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>-tm1env</code></td><td>TM1 environment to use. Defaults to the selected one.</td></tr><tr><td><code>-cube</code></td><td>Cube name to import into.</td></tr><tr><td><code>-sheet</code></td><td>Sheet name containing data.</td></tr><tr><td><code>-startRow</code></td><td>Starting data row (default: 1).</td></tr><tr><td><code>-startColumn</code></td><td>Starting data column (default: 1).</td></tr><tr><td><code>-skipBlank</code></td><td>Skips empty cells if enabled.</td></tr><tr><td><code>-checkIfUpdatable</code></td><td>Skips rule-calculated cells if enabled.</td></tr></tbody></table><p>You can use of the 2 possible data formats:</p><p><strong>Option 1: One value column</strong></p><ul><li>Each column represents a cube dimension.</li><li>Last column is labeled <code>Value</code>.</li></ul><p><img src="'+h+'" alt="tm1import task options" data-zoomable=""></p><p><strong>Option 2: One column per measure</strong></p><ul><li>Final columns represent each measure element.</li></ul><p><img src="'+m+'" alt="tm1import task elements" data-zoomable=""></p><p>TeamOne automatically detects the format and supports both principal names and aliases.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You can use Option 1 directly with data fetched via a <code>::tm1data</code> task, enabling two-way sync between <code>::tm1data</code> and <code>::tm1import</code>.</p></div><p>View <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=858904422" target="_blank" rel="noreferrer">::tm1import example</a></p><h2 id="tm1fileoutput" tabindex="-1"><code>::tm1fileoutput</code> <a class="header-anchor" href="#tm1fileoutput" aria-label="Permalink to &quot;`::tm1fileoutput`&quot;">​</a></h2><p>The <code>::tm1fileoutput</code> task exports sheet data to a delimited file on the TM1 server. Useful when TI processes use flat files for validation or transformation logic.</p><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>-tm1env</code></td><td>TM1 environment to use. Defaults to the selected one.</td></tr><tr><td><code>-sheet</code></td><td>Sheet name containing data.</td></tr><tr><td><code>-startRow</code></td><td>Starting data row (default: 1).</td></tr><tr><td><code>-startColumn</code></td><td>Starting data column (default: 1).</td></tr><tr><td><code>-rows</code></td><td>Number of rows to export (0 = all).</td></tr><tr><td><code>-columns</code></td><td>Number of columns to export (0 = all).</td></tr><tr><td><code>-file</code></td><td>Output file path (relative to TM1 data directory).</td></tr><tr><td><code>-delimiter</code></td><td>Field delimiter (default: tab).</td></tr></tbody></table><p><img src="'+p+'" alt="tm1fileoutput task" data-zoomable=""></p><p>View <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=858904422" target="_blank" rel="noreferrer">::tm1fileoutput example</a></p><h2 id="tm1datacompare" tabindex="-1"><code>::tm1datacompare</code> <a class="header-anchor" href="#tm1datacompare" aria-label="Permalink to &quot;`::tm1datacompare`&quot;">​</a></h2><p>The <code>::tm1datacompare</code> task compares results from an existing <a href="./#tm1data"><code>::tm1data</code></a> task between two time points or environments.</p><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>-tm1env</code></td><td>TM1 environment to compare against. Defaults to current.</td></tr><tr><td><code>-tm1data</code></td><td>Name of the <code>::tm1data</code> task used for comparison.</td></tr><tr><td><code>-activate</code></td><td>If set, switches to the <code>-sheet</code> from the <code>::tm1data</code> task.</td></tr></tbody></table><p>First, run the related <code>::tm1data</code> task to store baseline results. Then run <code>::tm1datacompare</code> to re-run the query and show differences:</p><p><img src="'+d+'" alt="tm1datacompare task" data-zoomable=""></p><div class="tip custom-block"><p class="custom-block-title">Compare TM1 data before and after deployments</p><p>Run <code>::tm1data</code> before making changes, then run <code>::tm1datacompare</code> after deployment to review changes on the original output sheet.</p></div><div class="tip custom-block"><p class="custom-block-title">Compare TM1 data between environments</p><p>Use the <code>-tm1env</code> option to define a second environment for comparison.</p></div><p>View <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=951520795" target="_blank" rel="noreferrer">::tm1datacompare example</a></p><h2 id="task-group" tabindex="-1"><code>::task.group</code> <a class="header-anchor" href="#task-group" aria-label="Permalink to &quot;`::task.group`&quot;">​</a></h2><p>The <code>::task.group</code> task lets you execute multiple tasks in a specific order with a single click. This is ideal for chaining together related steps, for example:</p><ul><li>Run IBM PA processes.</li><li>Import new data into TM1.</li><li>Recalculate dependent reports.</li></ul><table tabindex="0"><thead><tr><th>Option / Parameter</th><th>Description</th></tr></thead><tbody><tr><td><code>-info</code></td><td>Short description shown as a tooltip in the sidebar.</td></tr><tr><td><code>-hide</code></td><td>Hides the task from the sidebar.</td></tr><tr><td><code>TaskName1-TaskNameN</code></td><td>List of task names to run, in order, in <strong>column A</strong>. Each row contains one task name exactly as it appears in your task list. Leave <strong>column B</strong> empty.</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">Hiding individual tasks</p><p>You can hide the individual tasks (e.g., <em>Clear Upload Sheets</em>) from the sidebar using their <code>-hide</code> option, but still include them in a group.</p></div><p><img src="'+u+'" alt="task group" data-zoomable=""></p>',78)]))}const O=s(f,[["render",b]]);export{S as __pageData,O as default};
